import React from 'react';
import { useLocation, Link } from 'react-router-dom';

const Result = () => {
  const { state } = useLocation();

  if (!state) {
    return (
      <div className="container mt-5">
        <h4>No result data found.</h4>
        <Link to="/dashboard" className="btn btn-secondary mt-3">Back to Dashboard</Link>
      </div>
    );
  }

  return (
    <div className="container mt-5">
      <div className="card p-4">
        <h3>Analysis Result</h3>
        <p><strong>File:</strong> {state.filename}</p>
        <p><strong>AI-generated Content:</strong> {state.similarityScore}%</p>
        <Link to="/dashboard" className="btn btn-success mt-3">Upload Another File</Link>
      </div>
    </div>
  );
};

export default Result;
